This is a 3D drawing program where you can draw your design on a flat surface and then extrude it off the paper, you can draw on different faces to create almost any 3D design.
When you're finished you can also use the Photo Album (File&gt;New&gt;Photoalbum) where you can put different materials onto the design you have created you can use all different angles and put shadows on your design.
